import React from "react";

const StylingPanel = ({ tool, color, setColor, size, setSize, opacity, setOpacity, strokeStyle, setStrokeStyle, fill, setFill }) => {
    // Only show for tools that need styling
    const drawingTools = ["pencil", "highlighter", "rect", "circle", "line", "arrow", "text", "sticky", "eraser"];
    if (!drawingTools.includes(tool)) return null;

    const colors = [
        "#000000", "#475569", "#dc2626", "#ea580c", "#d97706",
        "#65a30d", "#0891b2", "#2563eb", "#7c3aed", "#db2777"
    ];

    return (
        <div className="styling-panel left-24 top-24 w-48">
            {/* Color Grid */}
            <div className="flex flex-col gap-3 pb-6 border-b border-slate-100">
                <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest">Color</span>
                <div className="grid grid-cols-5 gap-2">
                    {colors.map(c => (
                        <button
                            key={c}
                            onClick={() => setColor(c)}
                            className={`w-6 h-6 rounded-full border border-slate-200 transition-transform hover:scale-110
                                      ${color === c ? "ring-2 ring-violet-500 ring-offset-2" : ""}`}
                            style={{ backgroundColor: c }}
                        />
                    ))}
                </div>
            </div>

            {/* Size Slider */}
            <div className="flex flex-col gap-3 pb-6 border-b border-slate-100">
                <div className="flex justify-between items-center">
                    <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest">Thickness</span>
                    <span className="text-xs font-mono font-bold text-slate-600">{size}px</span>
                </div>
                <input
                    type="range"
                    min="1"
                    max="40"
                    value={size}
                    onChange={(e) => setSize(parseInt(e.target.value))}
                    className="w-full accent-violet-600 h-1.5 bg-slate-100 rounded-lg appearance-none cursor-pointer"
                />
            </div>

            {/* Opacity Slider */}
            <div className="flex flex-col gap-3 pb-6 border-b border-slate-100">
                <div className="flex justify-between items-center">
                    <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest">Opacity</span>
                    <span className="text-xs font-mono font-bold text-slate-600">{Math.round(opacity * 100)}%</span>
                </div>
                <input
                    type="range"
                    min="0.1"
                    max="1"
                    step="0.05"
                    value={opacity}
                    onChange={(e) => setOpacity(parseFloat(e.target.value))}
                    className="w-full accent-violet-600 h-1.5 bg-slate-100 rounded-lg appearance-none cursor-pointer"
                />
            </div>

            {/* Stroke Style & Fill */}
            <div className="flex flex-col gap-3">
                <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest">Style</span>
                <div className="flex items-center gap-2">
                    <button
                        onClick={() => setStrokeStyle('solid')}
                        className={`flex-1 py-2 rounded-lg border transition-all ${strokeStyle === 'solid' ? 'bg-violet-600 text-white border-violet-600 shadow-sm' : 'bg-white text-slate-600 border-slate-200 hover:bg-slate-50'}`}
                        title="Solid"
                    >
                        <div className={`h-0.5 mx-auto w-8 ${strokeStyle === 'solid' ? 'bg-white' : 'bg-slate-600'}`}></div>
                    </button>
                    <button
                        onClick={() => setStrokeStyle('dashed')}
                        className={`flex-1 py-2 rounded-lg border transition-all ${strokeStyle === 'dashed' ? 'bg-violet-600 text-white border-violet-600 shadow-sm' : 'bg-white text-slate-600 border-slate-200 hover:bg-slate-50'}`}
                        title="Dashed"
                    >
                        <div className={`h-0.5 mx-auto w-8 border-b-2 border-dashed ${strokeStyle === 'dashed' ? 'border-white' : 'border-slate-600'}`}></div>
                    </button>
                </div>
                {["rect", "circle"].includes(tool) && (
                    <button
                        onClick={() => setFill(!fill)}
                        className={`w-full py-2.5 rounded-xl text-xs font-bold transition-all ${fill ? 'bg-violet-600 text-white shadow-lg shadow-violet-200' : 'bg-slate-100 text-slate-600 hover:bg-slate-200'}`}
                    >
                        {fill ? "✓ FILLED" : "NO FILL"}
                    </button>
                )}
            </div>
        </div>
    );
};

export default StylingPanel;
